	public static int lengthOfLongestSubstring(String s)
	{
		if(s.length()==0)
			return 0;
        int tail = -1;
        String sub = "";
        int length = 0;
        HashMap<Character, Integer> hm = new HashMap<Character, Integer>();
        char c = 0;
        while(tail != s.length()-1)
        {
            tail++;
            c = s.charAt(tail);
            if(!hm.containsKey(c))
            {
                hm.put(c, tail);
                sub += c;
                if(sub.length()>length)
                	length = sub.length();
            }
            else
            {
            	for(int i=0;i<sub.length();i++)
            	{
            		if(sub.charAt(i)!=c)
            		{
            			hm.remove(sub.charAt(i));
            		}
            		else
            		{
            			sub = sub.substring(i+1, sub.length()) + c;
            			break;
            		}
            	}
            }
        }
        return length;
    }
